name: Panasonic Rice Flour and Brown Sugar Bread
servings: 10 servings
source: Panasonic
prep_time: 10 min
cook_time: 1 hr
categories: [Bread, Panasonic]
difficulty: Easy
nutritional_info: 143 calories
notes: |
  Do not use the glutinous rice flour. Decorate it with sugar-coating. Add 25 g of brown sugar power and 2.5g (less than 1⁄2 tsp) water into a small bowl, put the bowl in 60  ̊C water, stir the sugar well in the bowl against the hot water outside, and then pour the sugar paste onto the bread.
ingredients: |
  30  g warm water
  4.2 g instant dry yeast
  230 g high gluten flour
  50  g rice flour
  25  g butter
  34  g brown sugar
  12  g milk powder
  5   g salt
  25  g egg (evenly mixed)
  140 g warm water
directions: |
  Remove the bread pan and Set the kneading blade
  Add the ingredients other than the instant dry yeasts in the bread pan - high-gluten flour, water and other ingredients
  Add instant dry yeast into yeast dispenser
  Select menu “8” via the メニュー (Menu) rocker
  To add mixins, press レーズン:選択 (Raisin: Select) , Select あり (Yes) (make it flash) for automatic add - raisins, nuts, green beans or olives (<100g) or Select あり♪ (Yes♪) (make it flash) for manual add - macerated vegetables, fruits, cheese or chocolate, before Start
  To use gentle stir for easily crushed mixins, after the above, Press レーズン:混ぜ (Raisin:Stir) and select 粗混ぜ (make it flash) - needed for olives, green beans, cheese, chocolate or heated vegetables
  To change crust color, press 焼き色 (Crust), to select 淡 (Light), 標準 (Standard), 濃 (Dark)
  For delayed start, press 予約 (Timer), and then 時 (hours) and/or 分 (minutes) to adjust end time
  Press スタート (Start)
  Baking completes (Beep sound)
  Take out the bread pan and put it on a table with a towelette under it. When handling the bread pan, be sure to wear thick oven gloves.
  Cool down (about 2 min)
  Take out the bread for cooling down
